import React from 'react';
import './Footer.css';
import linkedInLogo from '../about/linkedin.png';
import emailLogo from '../about/gmail.png';
import logo from '../about/pngegg.png';

const Footer = () => {
    return (
        <div className="footer">
            <a><img className="icons" src={linkedInLogo}/></a>
            <a><img className="icons" src={emailLogo}/></a>
            <img className="icons" src={logo}/>
        </div>
    )
}

export default Footer;
